class OrderModel { var orderId; var orderUserId; var orderAddressId; var addressType; var orderPricedelivery; var orderPrice; var orderCoupon; var orderDatetime; var orderProductId; var orderProductsCount; var paymentMethod; var orderDelivery; var orderStatus; var orderInArchive;  OrderModel(      {this.orderId,        this.orderUserId,        this.orderAddressId,        this.addressType,        this.orderPricedelivery,        this.orderPrice,        this.orderCoupon,        this.orderDatetime,        this.orderProductId,        this.orderProductsCount,        this.paymentMethod,        this.orderDelivery,        this.orderStatus,        this.orderInArchive});  OrderModel.fromJson(Map<String, dynamic> json) {    orderId = json['order_id'];    orderUserId = json['order_user_id'];    orderAddressId = json['order_address_id'];    addressType = json['address_type'];    orderPricedelivery = json['order_pricedelivery'];    orderPrice = json['order_price'];    orderCoupon = json['order_coupon'];    orderDatetime = json['order_datetime'];    orderProductId = json['order_product_id'];    orderProductsCount = json['order_products_count'];    paymentMethod = json['payment_method'];    orderDelivery = json['order_delivery'];    orderStatus = json['order_status'];    orderInArchive = json['order_in_archive'];  }}